import React, { useState } from 'react';
import { Shirt, Zap, Dress, Jacket, Footprints, Gem } from 'lucide-react';

const CategoriesSection = ({ onCategorySelect }) => {
  const [selectedCategory, setSelectedCategory] = useState('all');

  const categories = [
    {
      id: 'all',
      name: 'All Items',
      icon: <Zap className="w-6 h-6" />,
      count: 245,
      color: 'bg-primary-500'
    },
    {
      id: 'tops',
      name: 'Tops & Shirts',
      icon: <Shirt className="w-6 h-6" />,
      count: 89,
      color: 'bg-blue-500'
    },
    {
      id: 'dresses',
      name: 'Dresses',
      icon: <Dress className="w-6 h-6" />,
      count: 56,
      color: 'bg-pink-500'
    },
    {
      id: 'outerwear',
      name: 'Outerwear',
      icon: <Jacket className="w-6 h-6" />,
      count: 34,
      color: 'bg-orange-500'
    },
    {
      id: 'bottoms',
      name: 'Bottoms',
      icon: <Footprints className="w-6 h-6" />,
      count: 42,
      color: 'bg-green-500'
    },
    {
      id: 'accessories',
      name: 'Accessories',
      icon: <Gem className="w-6 h-6" />,
      count: 24,
      color: 'bg-purple-500'
    }
  ];

  const handleCategoryClick = (categoryId) => {
    setSelectedCategory(categoryId);
    if (onCategorySelect) {
      onCategorySelect(categoryId);
    }
  };

  return (
    <div className="w-full">
      <div className="mb-8">
        <h2 className="text-2xl font-bold text-secondary-900 mb-2">Shop by Category</h2>
        <p className="text-secondary-600">Find exactly what you're looking for</p>
      </div>

      {/* Categories Grid - 3x2 layout */}
      <div className="grid grid-cols-2 md:grid-cols-3 gap-4">
        {categories.map((category) => (
          <button
            key={category.id}
            onClick={() => handleCategoryClick(category.id)}
            className={`
              group relative overflow-hidden rounded-xl p-6 text-left transition-all duration-200 
              hover:shadow-lg hover:-translate-y-1
              ${selectedCategory === category.id 
                ? 'ring-2 ring-primary-500 bg-primary-50' 
                : 'bg-white border border-secondary-200 hover:border-primary-300'
              }
            `}
          >
            {/* Background Pattern */}
            <div className="absolute top-0 right-0 -mt-4 -mr-4 opacity-10">
              <div className={`w-16 h-16 rounded-full ${category.color}`}></div>
            </div>

            {/* Icon */}
            <div className={`
              inline-flex items-center justify-center w-12 h-12 rounded-lg mb-4 transition-colors duration-200
              ${selectedCategory === category.id 
                ? `${category.color} text-white` 
                : 'bg-secondary-100 text-secondary-600 group-hover:bg-primary-100 group-hover:text-primary-600'
              }
            `}>
              {category.icon}
            </div>

            {/* Content */}
            <div>
              <h3 className={`
                font-semibold mb-1 transition-colors duration-200
                ${selectedCategory === category.id 
                  ? 'text-primary-700' 
                  : 'text-secondary-900 group-hover:text-primary-600'
                }
              `}>
                {category.name}
              </h3>
              <p className="text-sm text-secondary-500">
                {category.count} items available
              </p>
            </div>

            {/* Selection Indicator */}
            {selectedCategory === category.id && (
              <div className="absolute top-3 right-3">
                <div className="w-3 h-3 bg-primary-500 rounded-full"></div>
              </div>
            )}
          </button>
        ))}
      </div>

      {/* Quick Stats */}
      <div className="mt-8 p-4 bg-secondary-50 rounded-lg">
        <div className="flex items-center justify-center space-x-8 text-sm text-secondary-600">
          <div className="text-center">
            <div className="font-semibold text-secondary-900">245</div>
            <div>Total Items</div>
          </div>
          <div className="text-center">
            <div className="font-semibold text-secondary-900">89</div>
            <div>New This Week</div>
          </div>
          <div className="text-center">
            <div className="font-semibold text-secondary-900">156</div>
            <div>Active Sellers</div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default CategoriesSection;
